import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from './App';
import GuestLogin from './Pages(Didulanga)/GuestLogin';
import HomePage from './Pages(Didulanga)/HomePage';
import MarksEnter from './Pages(Didulanga)/MarksEnter';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/Pages(Didulanga)/GuestLogin" element={<GuestLogin/>} />
        <Route path="/Pages(Didulanga)/HomePage" element={<HomePage/>} />
        <Route path="/Pages(Didulanga)/MarksEnter" element={<MarksEnter/>} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
